function App() {
  return (
    <div>
      <h2>Let's get started!</h2>
      <ExpenseItem
        expensename={"Car Insurance"}
        location={"Gurgaon"}
      ></ExpenseItem>
      <ExpenseItem expensename={"Picnic"} location={"Hyderabad"}></ExpenseItem>
      <ExpenseItem expensename={"Movie"} location={"Delhi"}></ExpenseItem>
      <ExpenseItem
        expensename={"Furniture"}
        location={"Bangalore"}
      ></ExpenseItem>
      <ExpenseItem expensename={"Outing"} location={"Mumbai"}></ExpenseItem>s
    </div>
  );
}

export default App;
